import React from 'react';

function Navbar() {
    const path = window.location.pathname;


    return (
        <nav className="nav">
            <a href="/" className="site-title">ToroGrub</a>
            <ul>
                <li><a href="/pricing">Pricing</a></li>
                <li><a href="/about">About</a></li>

            </ul>
        </nav>
    );
}

export default Navbar;
